message:
[ImageMagick]{Support 'msf1' support in heic.c}

Analysis: {heif file's ftyp value is 'msf1' cause no decoder supported}
Solution: {add 'msf1' ftyp support in heic.c}

Signed-off-by: liuchang-cc <liuchang@oppo.com>

[ImageMagick]{Support to set quality when write heic file}

Analysis: {the quality value is invalid in image_info structure}
Solution: {use quality value in image structure when call heif_encoder_set_lossy_quality}

Signed-off-by: liuchang-cc <liuchang@oppo.com>

[ImageMagick]{call CloseBlob when read heic image end}

Analysis: {missing call CloseBlob cuase get heic image's length failed when read heic image from buffer}
Solution: {call CloseBlob when read heic image end}

Signed-off-by: liuchang-cc <liuchang@oppo.com>

[ImageMagick]{fix wrong logic when compare two floats value with == directly}

Analysis: {image's length call MagickWriteImages() isn't equal with call MagickGetImagesBlob(), compare two float values with == directly, it's not always expected result}
Solution: {compare two float value's difference with 1e-6 here}

Signed-off-by: liuchang-cc <liuchang@oppo.com>

[ImageMagick]{fix write progressive jpeg image file failed issue}

Analysis: {call MagickSetImageInterlacescheme but generate progressive jpeg file failed, the interlace isn't set into jpeg encoder successfully}
Solution: {use image->interlace value to replace image_info->interlace value}

