[ImageMagick]{Appropriate default kmin, kmax values for lossy and lossless into webp encoder}
Analysis: {if don't set default kmin and kmax,  some special gif images which background is transparent and has big screen change convert to animation webp， the webp files play unsmooth in chrome browser because of keyframe's distance is too big}
Solution: {Appropriate default kmin, kmax values for lossy and lossless into webp encoder refer gif2webp binary in libwebp}

Signed-off-by: liuchang-80280266 <liuchang@oppo.com>

While waiting on your build I decided to check if maybe we could solve this differently. The following also seems to work:

```c
  *minima=DBL_MAX;
  *maxima=DBL_MIN;
  for (i=0; i < (MagickOffsetType) number_pixels; i++)
  {
    pixel=GetFITSPixel(image,bits_per_pixel);
    if (IsNaN(pixel))
      continue;
    if (pixel < *minima)
      *minima=pixel;
    if (pixel > *maxima)
      *maxima=pixel;
  }
```

And it looks like I get the correct output image. Can you clarify why we would need to always check for a NaN inside `GetFITSPixel`? Maybe we should leave those pixels intact but don't use them to get the extrema's?

@dlemstra That's fine, it may not be necessary to check for NaN's in GetFITSPixel.

My concern was whether other parts of Image Magick knows how to handle NaNs. When setting each pixel on the Image object in `ReadFITSImage` it uses `GetFITSPixel` so anything that consumes those pixels like rendering will have to deal with a bunch of NaN pixels. I was thinking since NaN doesn't really make sense as a pixel value, that it would be safer for GetFITSPixel to return 0 (to represent black) for any NaN pixel value.

But you're right that the image still renders ok, so it's most likely fine. The problem I found was really just when `minima` and `maxima` start as NaN because the very first pixel in my image was NaN, then the image didn't get rendered.
